// for en translations are like object {regNumber: {errors: {required: ''}}
// for rest languages it will be string 'regNumber.errors.required'
import languages from '../languages';
export const getTranslationKey = (lang, key1, key2) => {
    if (lang === 'en') {
        // @ts-ignore
        return languages[lang].regNumber[key1][key2];
    }
    else {
        // @ts-ignore
        return languages[lang][`regNumber.${key1}.${key2}`];
    }
};
